import React from "react";
import styled from "styled-components";

const Done = () => {
  return <Wrapper>Done</Wrapper>;
};

export default Done;

const Wrapper = styled.div`
  border: 1px solid black;
  background: lightblue;
  flex-basis: 100%;
  width: 100%;
  height: 100%;
`;
